(7, 'information', 'textarea', 'We are one of the trust-able car exporter in Singapore, serving clients all over the world such as Africa, Caribbean, America, Europe, Asia, Oceania and many more. We sell brand-new as well as used-car from Singapore as per our clients requests. Give us your specifications and we will find the car for you. We value long-term working relationships with all of our clients who are the utmost importance to our business. Our reputation, ethics, and integrity are the main integral parts in our business which you will feel rest assured when dealing with us.'),
(8, 'contact', 'textarea', 'Contact Optimus Auto Trading Pte. Ltd.<br>\r\nAddress: 33 Ubi Avenue 3, Vertex Singapore 408868<br><br>\r\n\r\nPhone: +65 9751 0199 | +65 9898 7565 <br>\r\nEmail: info@optimusautotrading.com <br>\r\nBusiness Hours: 9:00 AM - 6:00 PM <br>\r\nSaturday, 9:00 AM - 12:00 PM. Closed on Sunday.\r\n'),
(9, 'contact email', 'text', 'yungfei1989@gmail.com'),
(10, 'term', 'textarea', 'Customer should be registered on our Website before making a transaction. (Registration is absolutely free!)\r\n\r\n<ul>\r\n<li>No deposit is required before confirming any car from the Inventory.</li>\r\n<li>Full or partial payment is required within seven days of confirmation via Telegraphic Transfer (TT).</li>\r\n<li>Prices are quoted in United States Dollars (USD) either in C&F or FOB terms</li>\r\n<li>Customers must pay in US Dollars.</li>\r\n<li>Attention! In case of refusal or payment delay for the cars bought from the auction house as Customer Order by due date, SBT reserve the right to charge cancel penalty of minimum $1,000 USD or its total loss and penalty charge. In case of refusal or delay of payment for the cars bought from SBT Inventory by due date, SBT reserve the right to charge the cancel penalty or its total loss and penalty.</li> \r\n</ul>\r\n\r\n<strong>How To Buy From Us</strong>\r\n<ol>\r\n<li>Sign Up/ Login Member\r\n\r\nIf you haven’t a member in our website, you can register with your full personal information.\r\n</li>\r\n<li>Find Car\r\n\r\nChoose your favorite car then select button “Negotiate” or you can as car’s wish list .</li>\r\n<li>Make a Negotiation\r\n\r\nOur sales will help you and make the good deal for prices. You just need to confirm our Proforma Invoice that created by our sales.</li>\r\n<li>Place Order\r\n\r\nFill all your complete information regarding name and address.</li>\r\n<li>Make Payment\r\n\r\nShare your payment transfer with us  or you just send the amount to our payment methods below.</li>\r\n<li>Received Item</li>\r\n</ol>\r\n\r\n<strong>PAYMENT METHOD</strong>\r\n\r\n<p>\r\n<strong>UOB-USD</strong><br>\r\nBANK NAME: UNITED OVERSEAS BANK<br>\r\nBANK CODE: 7375<br>\r\nBRANCH CODE: 495<br>\r\nSWIFT CODE: UOVBSGSG<br>\r\nBANK ADDRESS: 80 RAFFLES PLACE, UOB PLAZA 1, SINGAPORE 048624<br>\r\nACCOUNT NAME: OPTIMUS AUTO TRADING PTE LTD<br>\r\nACCOUNT NUMBER: 422-902-491-9<br>\r\n</p>\r\n<p>\r\nINTERMEDIARY BANK: BANK OF NEW YORK MELLON, NEW YORK<br>\r\nINTERMEDIARY BANK SWIFCODE: IRVTUS3N<br>\r\n</p>\r\n\r\n<p>\r\n<strong>UOB-EUR</strong><br>\r\nBANK NAME: UNITED OVERSEAS BANK<br>\r\nBANK CODE: 7375<br>\r\nBRANCH CODE: 448 (Hougang MRT Branch)<br>\r\nSWIFT CODE: UOVBSGSG<br>\r\n\r\nBANK ADDRESS: 80 RAFFLES PLACE, UOB PLAZA 1, SINGAPORE 048624<br>\r\nACCOUNT NAME: OPTIMUS AUTO TRADING PTE LTD<br>\r\nACCOUNT NUMBER: 396-901-250-0 <br>\r\n\r\n</p>\r\n<p>\r\nINTERMEDIARY BANK: BANK OF NEW YORK MELLON, NEW YORK<br>\r\n\r\nINTERMEDIARY BANK SWIFCODE: IRVTUS3N<br>\r\n\r\n</p>\r\n<p>\r\n<strong>UOB-SGD</strong><br>\r\n\r\n\r\nBANK NAME: UNITED OVERSEAS BANK<br>\r\nBANK CODE: 7375<br>\r\nBRANCH CODE: 495<br>\r\n\r\nSWIFT CODE: UOVBSGSG<br>\r\nBANK ADDRESS: 80 RAFFLES PLACE, UOB PLAZA 1, SINGAPORE 048624<br>\r\nACCOUNT NAME: OPTIMUS AUTO TRADING PTE LTD<br>\r\nACCOUNT NUMBER: 422-310-152-0 <br>\r\n\r\n</p>\r\n<p>\r\nINTERMEDIARY BANK: BANK OF NEW YORK MELLON, NEW YORK<br>\r\nINTERMEDIARY BANK SWIFCODE: IRVTUS3N<br>\r\n\r\n</p>'),
